        <div className='header-one'>
        <Navigation />
        <div className="header">
        <h1>{props.name}</h1>
        
      <h3>{props.title}</h3>
      <div className="a-group">
      <a href ="/" genre={props.genre}>Watch Now</a>
      </div>
      
      
       
       
        
        </div>
    
        </div>
        
    )
};

export default Landing;
